import { Carousel } from 'antd';

function Home() {

  const config = {
    autoplay: true,
  };

  return (<>
    <div style={{ width: '100%', height: '100vh' }}>
      <Carousel {...config}>
        <div>
          <h3 >1</h3>
        </div>
        <div>
          <h3 >2</h3>
        </div>
        <div>
          <h3 >3</h3>
        </div>
        <div>
          <h3 >4</h3>
        </div>
      </Carousel>
    </div>
  </>);
}
export default Home;
